--create database juntas_arbitrales;

--\c juntas_arbitrales;

create table public.arbitration_board
(

    id        serial
        constraint arbitration_board_pk
            primary key,
    create_at timestamp default now(),
    update_at timestamp,
    name      varchar(100) not null,
    email     varchar(100),
    phone varchar(20)

);


create unique index arbitration_board_name_uindex
    on  public.arbitration_board (name);


create table  public.TPAISES
(
    PAIS  varchar(100) not null,
    USUALTA  varchar(100),
    FALTA date,
    ISO2      varchar(100) not null,
    ISO3      varchar(100) not null,
    COUNTRY      varchar(100) not null,
    CD_PAIS      varchar(100)
);


create table public.country
(
    id   serial
        constraint country_pk
            primary key,
    name varchar(100) not null,
    iso2 varchar(100),
    iso3 varchar(100)
);
select PAIS,ISO2,ISO3 from public.TPAISES;

drop TABLE public.TPAISES;

create table public.document_type
(
    id        serial
        constraint document_type_pk
            primary key,
    create_at timestamp             not null,
    update_at timestamp,
    name      varchar(100)          not null,
    required  boolean default false not null
);



create unique index document_type_name_uindex
    on public.document_type (name);

	
create table public.notification_type
(
    id   serial
        constraint notification_type_pk
            primary key,
    name varchar(100) not null
);

create table public.province
(
    id   serial       not null
        constraint province_pk
            primary key,
    name varchar(100) not null
);


create table public.town
(
    id          serial       not null
        constraint town_pk
            primary key,
    province_id integer
        constraint town_province_cd_id_fk
            references public.province,
    name        varchar(100) not null
);

create index town_province_id_fk
    on public.town (province_id);

create table public.road_type
(
    id       serial     not null
        constraint road_type_pk
            primary key,
    code     varchar(2) not null,
    catastro varchar(40),
    name     varchar(100)
);


create table public.users
(
    id           bigserial
        constraint users_pk
            primary key,
    create_at    timestamp   not null,
    update_at    timestamp,
    name         varchar(40) not null,
    surname      varchar(20) not null,
    last_surname varchar(20) not null,
	dni varchar(20) not null
);



create table public.TGEN_MUNICIPIOS
(
    ID_MUNICIPIO           int,
    CD_PROVINCIA         int,
    CD_MUNICIPIO      int,
    MUNICIPIO  varchar(100)
);



select CD_PROVINCIA,MUNICIPIO from public.TGEN_MUNICIPIOS;

drop table public.TGEN_MUNICIPIOS;

create table public.location
(
    id           bigserial               not null
        constraint location_pk
            primary key,
    create_at    timestamp default now() not null,
    update_at    timestamp,
    address      varchar(200),
    number       int,
    block        varchar(100),
    portal       varchar(100),
    ladder       varchar(100),
    floor        varchar(100),
    door         varchar(100),
    road_type_id int                   
        constraint location_road_type_id_fk
            references road_type,
    town_id      int                   
        constraint location_town_id_fk
            references town
);

CREATE TYPE public.claimant_type AS ENUM ('OWN','THIRD');

create table public.claimant
(
    id            bigserial               not null
        constraint claimant_pk
            primary key,	
    create_at     timestamp default now() not null,
    update_at     timestamp,
	claimant_type        claimant_type,	
    name         varchar(100),
    lastname         varchar(100),
    nif         varchar(100),
    email         varchar(100),
    phone         varchar(20),
    dni          varchar(100),
    user_id       bigint                  not null
        constraint claimant_users_id_fk
            references users,
    location_id   bigint
        constraint claimant_location_id_fk
            references location
);

create index claimant_user_id_index
    on public.claimant (user_id);

create unique index claimant_user_id_location_id_uindex
    on public.claimant (user_id, location_id);



values ('Junta Arbitral Nacional');

values (now(),'Reclamación al Empresario',true),(now(),'Acreditación de Representación',true),(now(),'Doc opcional 1',false),(now(),'Doc opcional 2',false);

values ('Postal'),('Correo Electronico'),('Notifica');

create table public.arbitration
(
    id                   bigserial               not null
        constraint arbitration_pk
            primary key,
    create_at            timestamp default now() not null,
    update_at            timestamp,
    claimant_id          bigint                  not null
        constraint arbitration_claimant_id_fk
            references claimant,
    arbitration_board_id        int
        constraint arbitration_board_id_fk
            references arbitration_board,
    notification_type_id int
        constraint arbitration_notification_type_id_fk
            references notification_type,
    reason               varchar(500),
    aspiration           varchar(500),
    observation          varchar(500)
);

create index arbitration_board_id_index
    on arbitration (arbitration_board_id);

create index arbitration_claimant_id_index
    on arbitration (claimant_id);

values (1,now(),'system','system','system','12345678A');

values (2,now(),'client','client','client','87654321A');

create table public.claimed
(
    id            bigserial               not null
        constraint claimed_pk
            primary key,
    create_at     timestamp default now() not null,
    update_at     timestamp,
    email         varchar(100),
    phone         varchar(20),
    social_reason varchar(100),
    nif          varchar(100),
    location_id   bigint
        constraint claimed_location_id_fk
            references location
);

alter table public.arbitration
    add claimed_id bigint;

alter table public.arbitration
    add constraint arbitration_claimed_id_fk
        foreign key (claimed_id) references claimed;


alter table public.location
    add postal_code varchar(100);

create table public.document
(
    id               bigserial
        constraint document_pk
            primary key,
    create_at        timestamp not null,
    name             varchar(100),
    extension        varchar(100),
    path             varchar(200),
    sign_path        varchar(200),
    document_type_id bigint
        constraint document_document_type_id_fk
            references document_type,
    arbitration_id   bigint
        constraint document_arbitration_id_fk
            references arbitration
);

create index document_arbitration_id_index
    on public.document (arbitration_id);

create index document_document_type_id_index
    on public.document (document_type_id);


create table public.arbitration_status
(
    id   serial       not null
        constraint arbitration_status_pk
            primary key,
    name varchar(100) not null
);

values ('Borrador'),('Enviado'),('Revision');


alter table public.arbitration
    add arbitration_status_id int not null;

create index arbitration_arbitration_status_id_index
    on public.arbitration (arbitration_status_id);

alter table public.arbitration
    add constraint arbitration_arbitration_status_id_fk
        foreign key (arbitration_status_id) references arbitration_status;


create table public.represented
(
    claimant_id bigint not null
        constraint represented_pk
            primary key
        constraint represented_claimant_id_fk
            references claimant,
	create_at     timestamp default now() not null,
    update_at     timestamp,
    name        varchar(100),
    lastname    varchar(100),
    dni         varchar(20),
    email       varchar(100),
    phone       int,
    location_id bigint
        constraint represented_location_id_fk
            references location
);


create table public.arbiter_type(
	id serial not null constraint arbitration_type_pk primary key,
	create_at timestamp default now() not null,
    update_at timestamp,
    name varchar(100) not null
);
 
create table public.collegiate_type(
	id serial not null constraint collegiate_type_pk primary key,
	create_at timestamp default now() not null,
    update_at timestamp,
    name varchar(100) not null,
    arbiter_type_id int not null constraint collegiate_type_arbiter_type_id_fk references arbiter_type(id)
);
 
 
 
create table public.arbiter(
    id serial constraint arbiter_board_pk primary key,
    create_at timestamp,
    update_at timestamp,
    name varchar(100) not null,
    surnames varchar(100),
    nif varchar(20),
    email varchar(100) not null,
    deleted boolean,
   	arbitration_board_id int not null constraint arbiter_arbitration_board_id_fk references arbitration_board(id),
   	arbiter_type_id int not null constraint arbiter_arbiter_type_id_fk references arbiter_type(id),
   	collegiate_type_id int constraint arbiter_collegiate_type_id_fk references collegiate_type(id)
);
 
 
 
 
 
